  },
}));

function App() {
  // const classes = useStyles();
  return (
    <div className="App">
      <Box>
        {/* <BodyPoseDetection /> */}
        {/* <FaceLandmarkDetection /> */}
        {/* <SelfieSegmentationDetection /> */}
        <HandShapeDetection />
        {/* <FaceShapeDetection /> */}
      </Box>
      <Box>
        <Box display="flex">
          <IconButton aria-label="delete">
            <DeleteIcon />
